import React from 'react';
import LoginComponents from './components/login/LoginComponents.js';
import './App.css';

function App() {
  return (
    <div className="background">
      <LoginComponents />
      <b><h2>Simple Login With React</h2></b><br />
      <small>By Gerwin Jo</small>
    </div>
  );
}

export default App;
